import React from "react";

const NavBar = () => {
  return (
    <nav className="nav">
      <div className='item'>
        <a>Profile</a>
      </div>
      <div>
        <a>Massages</a>
      </div>
      <div>
        <a>News</a>
      </div>
      <div>
        <a>Music</a>
      </div>
      <div>
        <a>Setings</a>
      </div>
    </nav>
  );
};

export default NavBar;
